css:
.styleguide {
  position: relative;
  display: flex;
  flex-direction: column;
}
.styleguide a {
  text-decoration: underline;
}
.styleguide-controls {
  position: absolute;
  right: 8px;
  top: 8px;
  z-index: 100;
}
.styleguide-header {
  padding: 12px;
  border-bottom: 1px solid #000000;
}
.styleguide-header h1 {
  font-size: 2em;
  margin: 0 0 .5em 0;
  color: #000000;
}
.styleguide-header p {
  font-size: 1.2em;
}
.styleguide-header p:last-of-type {
  margin-bottom: 0;
}
.styleguide-sections {
  flex: 1;
  overflow: auto;
}
.styleguide-sections > section {
  background-color: #cbcbcb;
  padding: 0;
  border-bottom: 1px solid #000000;
  border-top: none;
}
.styleguide-sections > section:last-child {
  margin-bottom: 0;
}
.styleguide-sections > section.collapsed {
  background-color: #d0d0d0;
}
.styleguide-sections > section.collapsed > .section-heading {
  display: block;
  margin: 0;
  padding-bottom: 12px;
  color: #444444;
}
.styleguide-sections > section.collapsed > .section-heading:hover {
  color: #000000;
  background-color: rgba(0, 0, 0, 0.1);
}
.styleguide-sections > section.collapsed > .section-heading:active {
  background-color: #d0d0d0;
}
.styleguide-sections > section.collapsed > * {
  display: none;
}
.styleguide-sections .section-heading.section-heading {
  padding: 12px 12px 0 12px;
  cursor: pointer;
  font-weight: normal;
  font-size: 1.8em;
  color: #000000;
}
.styleguide-sections section > h2 {
  font-size: 1.5em;
  line-height: 1.2;
  margin: 1em 12px 0 12px;
  color: #000000;
}
.styleguide-sections section > p {
  font-size: 1.1em;
  margin: 0.5em 12px 1em 12px;
}
.styleguide .example {
  display: flex;
  flex-wrap: wrap;
  border-radius: 0px;
  padding: 4px;
}
.styleguide .example .example-rendered,
.styleguide .example .example-code {
  position: relative;
  flex: 1 1 300px;
  min-width: 0;
  margin: 4px;
  border-radius: 0px;
  border: 1px solid #000000;
}
.styleguide .example .example-rendered {
  padding: 8px;
  background: #d0d0d0;
  overflow: hidden;
}
.styleguide .example .example-code {
  background-color: #282c34;
}
.styleguide .example .example-code pre {
  border: none;
  background-color: inherit;
}
